import React from 'react'
import { StyleSheet, View, Text } from 'react-native'

function Settings() {
  return (
    <View style={styles.container}>
       <Text style={styles.cle} >
         Numéro de la salle : <Text>5</Text>
       </Text>
       <Text style={styles.cle} > 
         Capacité de la salle : <Text>41 personnes</Text>
       </Text>
       <Text style={styles.cle} >
         Matériel : Projecteur, Tableau, chaise, Table
       </Text>
       <Text style={styles.cle} >
         Disponibilité : <Text>encore disponible</Text>
       </Text>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#0E4452'
  },
  nom: {
    color: 'white'
  },
  capacite: {
    color: 'white'
  },
  materiel: {
    color: 'white'
  },
  disponibilite: {
    color: 'white'
  },
})

export default Settings
